import './Works.scss';

const Works = () => {
  return (
    <div className="works flex" id="works">
      <div className="slider">
        <div className="container flex">
          <div className="item">
            <div className="left"></div>
            <div className="right"></div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Works;
